sentences:
  - 'Like other fatty fish, mackerel contains the marine fatty acids DHA and eicosapentaenoic acid (EPA), which have chemopreventive properties.'
  - These marine fatty acids have been shown to inhibit proliferation of breast cancer cells in the laboratory.
  - Relatively high fatty fish intake has been shown to be associated with reduced risk of breast cancer and improved survival.
  - 'In one experiment, higher omega-3 to omega-6 fatty acid diets reduced mammary gland density in mice, which in turn reduced carcinogen-induced mammary tumor development.'
  - Fish oil has been shown to inhibit early stages of mammary tumor development in a mouse model of HER-2/neu overexpressing (HER2+) breast cancer.
  - DHA has been demonstrated to reduce bone metastasis in a mouse model of breast cancer.
  - 'Many epidemiological studies have found convincing evidence of a negative association between DHA and EPS intake or fatty fish consumption and the risk of breast cancer, although not all are in agreement.'
  - One study concluded that higher intakes of fish were actually associated with higher incidence rates of ER+ breast cancer for postmenopausal women.
  - Several studies have found that higher omega-3 to omega-6 fatty acid ratios are associated with reduced risk of breast cancer; consuming mackerel would tend to improve the ratio for most women.
  - Marine fatty acids have also been found to enhance the therapeutic effects of tamoxifen and chemotherapy drugs such as Adriamycin and Taxol.
  - 'However, note that recent research suggests that mackerel and similar fish should not be consumed the day before through the day after a chemotherapy treatment and in moderation during the remaining days of each cycle.'
  - 'Mackerel contains a fatty acid (hexadeca-4,7,10,13-tetraenoic acid) that can induce resistance to a broad spectrum of chemotherapy drugs.'
